import React from 'react';

function InProgressColumn() {
    return (
        <div className="column in-progress">
            <h2>In Progress</h2>
            {/* 任务列表将在这里展示 */}
        </div>
    );
}

function ToDoColumn({ tasks, addTask, removeTask }) {
    return (
      <div className="column todo">
        <h2>待办事项</h2>
        <ul>
          {tasks.map(task => (
            <li key={task.id}>
              {task.text}
              <button onClick={() => removeTask(task.id, 'todo')}>删除</button>
            </li>
          ))}
        </ul>
      </div>
    );
  }


export default InProgressColumn;
